              </div>
              <div>
              <img src={bali} alt="bali" style={{height: 250}} />
              </div>
              <div>
              <img src={bali} alt="bali" style={{height: 250}} />
              </div>
            </Slider>
          </div>
        </div>
      </div>
    );
  }
}
